// make sure you install react-bootstrap! use npm install react-bootstrap bootstrap
import React from 'react';
import Head from 'next/head';

import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';

export default () => (
  <div>
    <Head>
      <title>My styled page</title>
      <link href="/static/style.css" rel="stylesheet" />
    </Head>
    <p className="welcomeback">
      Welcome Back!
    </p>
    <div className='schedule'>
        <Button variant="outline-dark" className="button">New Schedule</Button>
    </div>
    <div className='catelog'>
        <Button variant="outline-dark" className="button" style={{'margineLeft': '1700px'}}>New Schedule</Button>
    </div>
  </div>
)

